import React from 'react';
import Container from 'react-bootstrap/Container';

const product = ({productName, prodImage, posX, posY}) => { 
    // return(<div style={{objectPosition: `${posX} ${posY}`, position: 'absolute'}}>
    // return(<div style={{objectPosition: '120px 24px', position: 'absolute', left: `${posX}%`, top: `${posY}%`}}>
    return(<div style={{position: 'absolute', left: `${posX}%`, top: `${posY}%`}}>
        {productName}
        <Container>
            <img src={prodImage} style={{width:100, height:50}}/>
        </Container>
    </div>) 
}

export default product;
